好评。京东自营的正大品牌鸡蛋，关键是无抗（无抗生素），还有检验证书，质量信得过；京东自营快递发送货速度很快，次日达。
鸡蛋包装很规范，没有破损，全程冷链配送，保鲜。
在直播间买的，直播间带货小姐姐很漂亮的哟&hellip;&hellip;

好评。
京东自营，品质信得过；正大品牌，品牌信得过。京东自营快递，次日达；京东快递小哥很辛苦同时态度很好，点赞！
第一次在正大直播间买东西，直播小姐姐很漂亮哟&hellip;&hellip;
说正题：正大鸡蛋个头大，包装很好，每枚蛋上都有生产日期，全程冷链运输，没有坏&ldquo;蛋&rdquo;，蛋黄呈橙黄色，味道很好。要不是冰箱冷藏箱容积有限，都要下单三箱。
618确实实惠啊，下一次这么实惠估计得双十一了吧！双十一早点来吧&hellip;&hellip;&hellip;&hellip;
